import React from 'react'

const Balances = ({stakingBalance, rewardBalance}) => {
  return (
    <div className='balances-wrapper'>
      <div>Staking Balance{stakingBalance}</div>
      <div>Reward Balance{rewardBalance}</div>
    </div>
  )
}

export default Balances
